import React, {Component} from 'react';

const Titles = [
  'Member of IEEE at JMI',
  'studied at Hazrat Ali Academy',
  'lived in Muzaffarpur, Bihar',
  'Current city Delhi'
]


class Title extends Component{
  state = {titleIndex : 0};
  render(){
    const title = Titles[this.state.titleIndex];
    return(
      <P>{title}</P>
    )
  }
}

export default Title;
